import{WorkExperienceRepository}from"../../repository/work-experience-repository.js";import{DatetimeUtility}from"../../shared/utility/datetime-utility.min.js";class OsExperienceGraphModel{getDatabaseExperience=()=>{const e=(new WorkExperienceRepository).getAll(),t={};for(const o of e){if(!o.os||0===o.os.length)continue;if(!o.period.from||!o.period.to)continue;const e=DatetimeUtility.getNumberOfDays(o.period.from),i=DatetimeUtility.getNumberOfDays(o.period.to)-e;for(const e of o.os)t[e]||(t[e]=0),t[e]+=i}return t}}export{OsExperienceGraphModel};